import React, { useEffect, useState } from "react";

const Dashboard = ({ userEmail }) => {
  const [commission, setCommission] = useState(null);
  const [violationsAndArs, setViolationsAndArs] = useState([]);

  // ✅ URLs from your deployed Apps Scripts
  const COMMISSION_URL =
    "https://script.google.com/macros/s/AKfycbzSjgMyzv1ciX5MeW_f5Doh9gWydDGpN2Txz8gUSdf1nNq8TpxWlyyGFvJCbG-QwJM4/exec";
  const VIOLATIONS_URL =
    "https://script.google.com/macros/s/AKfycbxZzWnwoQ-h7mdlo-llohmKhWsctscq_sCHVF62zhpP26Oib39aiwklIz0HuOAA_EYG/exec";

  useEffect(() => {
    // Fetch weekly commission
    fetch(COMMISSION_URL)
      .then((res) => res.json())
      .then((data) => {
        const match = data.find(
          (row) =>
            row.emails &&
            row.emails.toLowerCase().trim() === userEmail.toLowerCase().trim()
        );
        setCommission(match || null);
      })
      .catch((err) => console.error("Commission fetch failed", err));

    // Fetch violations and ARs
    fetch(VIOLATIONS_URL)
      .then((res) => res.json())
      .then((data) => {
        const filtered = data.filter(
          (row) =>
            row.agentEmail &&
            row.agentEmail.toLowerCase().trim() === userEmail.toLowerCase().trim()
        );
        setViolationsAndArs(filtered);
      })
      .catch((err) => console.error("Violations fetch failed", err));
  }, [userEmail]);

  return (
    <div style={{ padding: "2rem" }}>
      <h2>Welcome, {userEmail}</h2>

      <h3>Your Weekly Commission</h3>
      {commission ? (
        <ul>
          <li>Total NBS: {commission.totalnbs}</li>
          <li>Gross Pay: ${commission.grosspay?.toFixed(2)}</li>
          <li>Bonus Qualified: {commission.qualifiedyesno}</li>
        </ul>
      ) : (
        <p>No commission data found.</p>
      )}

      <h3>Your Scanning Violations & ARs</h3>
      {violationsAndArs.length > 0 ? (
        <ul>
          {violationsAndArs.map((item, i) => (
            <li key={i}>
              <strong>{item.type}</strong> | Week: {item.week} | ${item.amountOwed}  
              <br />
              {item.details}
            </li>
          ))}
        </ul>
      ) : (
        <p>No violations or ARs found.</p>
      )}
    </div>
  );
};

export default Dashboard;
